import { BrowserRouter, Route, Switch } from "react-router-dom";
import Presentation from "./pages/Presentation";

function App() {
  return (
    <BrowserRouter>
      <Switch>
        <Route path="/" exact component={Presentation} />
      </Switch>
    </BrowserRouter>
  );
}

export default App;
